#!/usr/bin/env python
# -*- coding: utf-8 -*-

from datetime import date
from sys import exit
import zlib, base64

compressed = ""
thetext = zlib.decompress(base64.b64decode(compressed))

thenow = date.today()
theend = date(thenow.year,thenow.month,thenow.day)
theone = date(thenow.year,1,1)
theday = (theend - theone).days

if (theday < 0) or (theday > 366):
    exit("Something went wrong with the calculations. Sorry.")

verses = thetext.split('\n')

# There's a blank line, so we can use the day
# without subtracting to make 1 january = 0
print("%d. %s") % (theday, verses[theday])
